import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import Avatar from '@material-ui/core/Avatar';
import MyLocationIcon from '@material-ui/icons/MyLocation';
import EventIcon from '@material-ui/icons/Event';
import GitHubIcon from '@material-ui/icons/GitHub';
import ApartmentIcon from '@material-ui/icons/Apartment';

const useStyles = makeStyles(theme => ({
   
    paper: {
      height: '100%',
      overflowY:'scroll',
      backgroundColor: theme.palette.background.paper,
      boxShadow: theme.shadows[5],
      padding: theme.spacing(0, 0, 0),
      outline: 'none',
      margin: '1%',
      display:"flex",
      flexDirection:'column',
      justifyContent: "center",
      alignItems: "center",
      boxShadow: "0 16px 19px rgba(0,0,0,0.2), 0 15px 15px rgba(0,0,0,0.2)",
      '&:hover': {
        boxShadow: "0 2px 4px rgba(0,0,0,0.25), 0 2px 2px rgba(0,0,0,0.22)"
      },
      [theme.breakpoints.down('md')]: {
        width: '100%',
        height: '100%',
      },
      [theme.breakpoints.down('sm')]: {
        padding: theme.spacing(0, 0, 0),
        width: '100%',
        height: '100%',
      },
    },

    profileImage:{

        width:'40%',
        height:'40%',
        margin: "5px auto"
    },
  

    section:{
        display:"flex",
        flexDirection:"column",
        justifyContent:"space-around"
        

    }
  
  }))


function CommitActivityCard(props) {
    
    const classes = useStyles();

  
      const project = () => {
        console.log(props.feedie.type,"type")

        switch(props.feedie.type) {
          case "PushEvent":   
          return (

            <>
              <h1>PushEvent</h1>

            </>
          );
          case "PullRequestEvent":   
          return (
            <>
            <h1>PullRequestEvent</h1>

            </>

          );
          case "PullRequestReviewEvent ": 
          return(
          <>
            <h1>PullRequestReviewEvent</h1>

            </>
          );
          case "CreateEvent":  
          return (
          <>
            <h1>CreateEvent</h1>

            </>
          );
  
          default:      
          return (
            <>
              <h1>No project match</h1>

            </>
          )
        }
      }

    



  return (

  <>
    <Card className={classes.paper} style={{ backgroundColor:"mintcream",border: "black",  mwidth: "95%",maxHeight:"200px",margin:"10px"}}  onClick={event =>  window.location.href=`${props.follow.html_url}`}>  

    <div className={classes.section} style={{backgroundColor:"mintcream",border: "black",  maxWidth: "95%",maxHeight:"200px",margin:"10px"}}>

      <div style={{width:'100%'}}>{ project() }</div>

    </div>
      
    </Card>

   


  </>
  );
}

export default CommitActivityCard;
